#include <iostream>
#include <vector>

using namespace std;

int searchInsertInternal(vector<int>& a, int binarySearchFromIndex, int binarySearchEndIndex, int target)
{
	int midIndex = (binarySearchEndIndex + binarySearchFromIndex) / 2;
	int midTarget = a[midIndex];
	if (target == midTarget)
		return midIndex;

	if (binarySearchFromIndex == midIndex)
	{
		if (target <= a[binarySearchFromIndex])
			return binarySearchFromIndex;

		return binarySearchFromIndex + 1;
	}

	if (target < midTarget)
		return searchInsertInternal(a, binarySearchFromIndex, midIndex - 1, target);
	else
		return searchInsertInternal(a, midIndex + 1, binarySearchEndIndex, target);
}


int searchInsert(vector<int>& a, int target)
{
	if (a.size() == 0 || target <= a[0])
		return 0;

	if (target == a[a.size() - 1])
		return a.size() - 1;

	if (target > a[a.size() - 1])
		return a.size();

	return searchInsertInternal(a, 0, a.size() - 1, target);
}

